import logo from "./img/S_logo.png";
import { Squash as Hamburger } from "hamburger-react";
import "./img/Acme-Regular.ttf";

const Topbar = () => {
  return (
    <div
      id="Topbar"
      className="flex items-center justify-between p-2 border-b-2 border-black bg-my-yellow "
    >
      <div id="title" className="flex items-center justify-center p-0 m-0 ">
        <div id="title-logo" className="w-12 p-0 m-0">
          <a href="#">
            <img src={logo} alt="logo" srcset="" />
          </a>
        </div>
        <div id="title-name">
          <p style={{ "font-family": "Acme" }} className="text-4xl capitalize">
            Mately
          </p>
        </div>
      </div>
      <div id="menu-button">
        <Hamburger rounded size={28} />
      </div>
    </div>
  );
};
export default Topbar;
